CREATE TABLE go_keywords (
    "break" Text,
    "default" Text,
    "func" Text,
    "interface" Text,
    "select" Text,
    "case" Text,
    "defer" Text,
    "go" Text,
    "map" Text,
    "struct" Text,
    "chan" Text,
    "else" Text,
    "goto" Text,
    "package" Text,
    "switch" Text,
    "const" Text,
    "fallthrough" Text,
    "if" Text,
    "range" Text,
    "type" Text,
    "continue" Text,
    "for" Text,
    "import" Text,
    "return" Text,
    "var" Text,
    "q" Text,
    PRIMARY KEY ("break")
);



